import React from 'react'

export default function Nota({ nota }) {
    return (
        <div className='container'>
            <div className="row">
                <div>
                    <ul className="list-group" key={nota._id}>
                        <li className="list-group-item" >{nota._id}</li>
                        <li className="list-group-item">{nota.titulo}</li>
                        <li className="list-group-item">{nota.descripcion}</li>
                        <li className="list-group-item">{nota.fecha_creada}</li>
                    </ul>
                    {/* <Link to={`/editarnota/${nota.idnota}`}><ul className='btn btn-success'>Editar</ul></Link> */}
                    &nbsp;
                    {/* <button className='btn btn-danger' onClick={() => { elimiarnota(nota._id) }}> Eliminar</button> */}
                    <hr className="mt-4" />
                </div>
            </div>
        </div>
    )
}
